import './IncomingCallDialog.css';

const IncomingCallDialog=({callerUsername})=>{
   const handleAcceptButtonPressed=()=>{
    //ACCEPT THE CALL
   }
   const handleRejectButtonPressed=()=>{
    //REJECT THE CALL
   }
    return (
      <div className='direct_call_dialog background_secondary_color'>
        <span className='direct_call_dialog_caller_name' > {callerUsername}
            CALLER
        </span>

        <div className='direct_call_dialog_button_container'>

  
        <button className='direct_call_dialog_accept_button' onClick={handleAcceptButtonPressed}>
            Accept
        </button>
        <button className='direct_call_dialog_accept_button' onClick={handleRejectButtonPressed}>
            Reject
        </button>
        </div>
      </div>
    );
 
}
export default IncomingCallDialog;
